                    <div className="comfortableBox">comfortable</div>
                    <div className="experienceBox">experience</div>
                    <div className="toolsBox">tools</div>
                    <div className="storyBox">Story</div>
                    <div className="socialBox">social</div>
            </div> 
        </div>
       <Footer/>





        <style jsx global>{`
            body{
                margin: 0;
            } 
        `}
        </style>
    </div>
)

